import React from 'react';
import './Iso.css';

function Iso() {
  return (
    <div className="iso-container">
      <img src="" alt="ISO Certification" className="iso-image fade-in" />
      <div className="iso-details fade-in">
        <h2 className="iso-title">ISO Certification</h2>
        <p className="iso-description">
          Our ISO certification demonstrates our commitment to quality management systems, ensuring that we consistently provide products and services that meet customer and regulatory requirements.
        </p>
      </div>
    </div>
  );
}

export default Iso;
